import React from "react";
import "./Product.css";

function Product() {
  return (
    <div className="Product">
      <img
        src="https://m.media-amazon.com/images/I/81qmr73LcfL._AC_UY436_FMwebp_QL65_.jpg"
        alt=""
      />
      <div className="Product_info">
        <p>
          General Mills Cereals Assorted Variety Pack Wholesome Bowl Pack Cereal
          (Pack of 96)
        </p>
        <p className="Product_price">
          <small>$</small>
          <strong>61.77</strong>
        </p>
      </div>
      <div className="Product_rating"></div>
      <button>Add to Basket</button>
    </div>
  );
}

export default Product;
